import styled from "styled-components";
import { RewardItem } from "./Item";

export const ComponentRewardList = () => {
    return (
        <StyledContainer>
            <div className="money">200 points</div>
            <div className="list-reward">
                <SwiperSlide>
                    <RewardItem />
                    <RewardItem />
                    <RewardItem />
                </SwiperSlide>
            </div>
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    width: 90%;
    margin: 0 auto;
    padding: 25px 0;
    position: relative;
    .money {
        font-style: normal;
        font-weight: 600;
        font-size: 16px;
        line-height: 21px;
        color: #a7a7a7;
        margin-bottom: 12px;
    }
    .list-reward {
        display: flex;
    }
`;
